func (r *itemRegistry) ByID(id int) (gamedata.Item, bool) { v, ok := r.byID[id]; return v, ok }
func (r *itemRegistry) ByName(name string) (gamedata.Item, bool) {
	v, ok := r.byName[name]
	return v, ok
}
func (r *itemRegistry) All() []gamedata.Item { return r.all }
